function getCssImgLocation() {
	var path = $.trim(getLocation("ces.coral.js"));
	if(path!="")return path+"../css/validate/img/";
	var _;
	var curWwwPath = window.document.location.href;
	var pathName = window.document.location.pathname;
	var pos = curWwwPath.indexOf(pathName);
	var localhostPath = curWwwPath.substring(0, pos);
	_ = pathName.substring(0, pathName.substr(1).indexOf('/') + 1);
	return _ + "/common/css/validate/img/";
}
function getLocation(path) {
	var scriptEls = document.getElementsByTagName( 'script' );
    var scriptFolder;
    path = path.toLowerCase();
    var _, index;
    for (var i = 0; i < scriptEls.length; i++) {
    	var scriptPath = scriptEls[i].src;
        _ = scriptPath.substring(0, scriptPath.toLowerCase().indexOf(path));
        index = _.lastIndexOf("/");
        if (index > 0) {
            _ = _.substring(0, index + 1);
        }
        if (_) {
        	scriptFolder = _;
            break;
        }
    }
    return scriptFolder;
}
