var validate_tip= "#validate_tip";//和hintinfo共用了一个ID
$(document).ready(function(){
	$(document).delegate("input[maxlength], textarea[maxlength]","keyup",function(){
		var param = $(this).attr("maxlength");
		//浏览器兼容问题，如果没有maxlength属性，FF的max=-1和IE的max=2147483647
		if(param==-1||param==2147483647){
			return false;
		};
		var value = $(this).val();
		$(validate_tip).remove();
		var json = {
				color : "#222222",
				position : "absolute",
				background:"#E4EAF5",
				border:"#aaaaaa 1px solid",
				display:"none"
			};
		label = "<div class='.ui-widget-content' style='font-size:13px;z-index:20000;margin-bottom:10px;' id='"+validate_tip.slice(1)+"'>你还可以输入"+param+"个字</div>";
		$(this).after(label);
		var top = $(this).position().top-20;
		$(validate_tip).css(json).css({left : $(this).position().left + "px", top : top+ 'px'}); 
		var len=param-$.trim(value).len($(this).attr("textlength")); 
		if(len<0){
			var len=0;
			this.value = value.substr(0,param);
		};
		var show="你还可以输入"+len+"个字"; 
		//需求要求提示信息不能和错误信息一起出现
		var id = $(this).attr("id");
		var idOrName = (id==null||id=="")?$(this).attr("name"):id;
		var errdiv = $('div[for='+ idOrName + ']');
		if(errdiv.length == 0){
			$(validate_tip).text(show).show();
		}else{
			$(validate_tip).remove();
		}
		return false;//防止默认动作
	});
	$(document).delegate("input[maxlength],textarea[maxlength]","blur",function(){
		$(validate_tip).remove();
		return false;
	});
});
